CREATE TABLE `bowling_details` (
  `player_id` int(10) UNSIGNED NOT NULL,
  `innings` int(11) NOT NULL,
  `bowling_average` double NOT NULL,
  `balls_bowled` int(11) NOT NULL,
  `economy` double NOT NULL,
  `bowling_style` varchar(255) NOT NULL,
  `wickets_taken` int(11) NOT NULL,
  `best_bowling_figure` varchar(255) NOT NULL,
  `bowling_strike_rate` double NOT NULL,
  `catches` int(11) NOT NULL,
  `stumpings` int(11) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


